def vertical_text():
    import sys
    input = sys.stdin.read
    data = input().split()

    N = int(data[0])
    strings = data[1:]

    max_length = max(len(s) for s in strings)

    result = [''] * max_length

    for j in range(max_length):
        for i in range(N):
            if j < len(strings[i]):
                result[max_length - j - 1] += strings[i][j]
            else:
